import React from "react";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import "./App.css";
import NavBar from "./Component/NavBar";
import Product from "./Component/Product";
import Content from "./Component/Content";

function App() {
  const products = [
    { id: 1, productName: "Product 1", productDesc: "Description for Product 1" },
    { id: 2, productName: "Product 2", productDesc: "Description for Product 2" },
    { id: 3, productName: "Product 3", productDesc: "Description for Product 3" },
    { id: 4, productName: "Product 4", productDesc: "Description for Product 4" },
    { id: 5, productName: "Product 5", productDesc: "Description for Product 5" },
    { id: 6, productName: "Product 6", productDesc: "Description for Product 6" },
    { id: 7, productName: "Product 7", productDesc: "Description for Product 7" },
    { id: 8, productName: "Product 8", productDesc: "Description for Product 8" },
  ];
  let data = [
    {
      trackName: "React",
      bgColor: "bg-success",
      instName: "Abdelfattah Elnaggar",
    },
  ]
  return (
    <div className="App">
      <NavBar />
      <Container fluid className="py-5">
        <Row xs={1} sm={2} md={3} lg={4} className="g-4 justify-content-center">
          {products.map((product) => (
            <Col
              key={product.id}
              className="d-flex justify-content-center"
              style={{ maxWidth: "300px" }}
            >
              <Product
                productName={product.productName}  
                productDesc={product.productDesc}
              />
            </Col>
          ))}
        </Row>
      </Container>
      <Content objectData={data[0]}>
        <button className="btn btn-outline-danger fw-5">Show More!</button>      
      </Content>
    </div>
  );
}

export default App;
